import React from 'react'
import { getFormSubmissionInfo } from 'react-router-dom/dist/dom';
import './Response.css';
import './Home.js';
function Response(){
  return (
    <div className="ResponseScreen">

      <h2 className="h2">Payment succesful for the foolowing person:</h2>
      <pre>
        Name:{getFormSubmissionInfo.name}
      </pre>
    </div>
  )
}

export default Response;
